#include "../headers/global.hpp"
using namespace std;

bool is_part_of(string s,string rs) {
  int idx = 0;
  while(idx < rs.size()) {
    //cout << "s = " << s  << "#" << " rs = " << s << endl;
    if(s[idx] == rs[idx]) {
      idx++;
      continue;
    } 
    return false;
  }
  return true;
}
string shortestPalindrome(string s) {
  string rs = s;
  string sst = "";
  reverse(rs.begin(),rs.end()); //abcd => dcba
  int idx = 0;
  for(int i=0;i<rs.size();i++) {
    //cout << "rs.substr( " << idx << ") = " << rs.substr(idx) << endl;
    if(is_part_of(s,rs.substr(idx))) {
      break;
    } else {
      idx++;
    }
  }
  //cout << "s = " << s  << " | rs = " << rs << endl;
  cout << rs.substr(0,idx)  << "#" << s << endl;
  return rs.substr(0,idx) + s;
}


int main() {
  shortestPalindrome("abcd"); //r = 
  shortestPalindrome("aacecaaa"); //aaacecaaa
  shortestPalindrome("abad"); //aaacecaaa
  shortestPalindrome("dedcba"); //aaacecaaa
  shortestPalindrome("aacecaaazz"); //zzaaacecaaazz
  //aacecaaa+#+aacecaaa
  
  //abad => dabad
  //daab
}

